import React, { useEffect } from "react";
import { View, Text, StyleSheet, Button } from "react-native";
import defaultStyles from "../config/styles";

const HomeScreen = ({ navigation }) => {
	useEffect(() => {
		font.loadAsync({
			"alfa-slab": require("./app/assets/fonts/AlfaSlabOne-Regular.ttf"),
			"bowlby-one": require("./app/assets/fonts/BowlbyOneSC-Regular.ttf"),
		});
	}, []);

	return (
		<View style={styles.container}>
			<Text style={styles.textStyle}> Welcome to the Home Screen </Text>
			<Button
				title="See Details"
				onPress={() => navigation.navigate("Details")}
			/>
		</View>
	);
};

const styles = StyleSheet.create({
	container: {
		flex: 1,
		justifyContent: "center",
		alignItems: "center",
	},
	textStyle: {
		fontFamily: defaultStyles.fonts.alfa_slab,
	},
});

export default HomeScreen;
